import React from 'react';
const CreateNode = () => {
    return(
        <>
            <div className="main_div">
                <form>
                    <input type="text" placeholder="Title" value={note.title} onChange={InputEvent}/>
                    <textarea rows="" column="" placeholder="Write note here"  autoComplete="off" value={note.content} onChange={InputEvent}></textarea>
                </form>
            </div>
        </>
    );
}
export default CreateNode;
